import React from 'react';
import './UserDashboard.css'; // Use a relative path for consistency

const Dashboard = () => {
    return (
        <div className="dashboard-container">
            <header className="dashboard-header">
                <div className="profile-logo" title="Profile">
                    {/* Profile Image or Initial */}
                    P
                </div>
                <input
                    type="text"
                    className="search-bar"
                    placeholder="Search..."
                    aria-label="Search"
                />
                <div className="message-icon" title="Messages">
                    {/* Message Icon */}
                    M
                </div>
            </header>

            <main className="dashboard-content">
                {/* Example Content */}
                <h1>Welcome to IdeaNexus!</h1>
                <p>Your posts, profiles, and interactions will be displayed here. Start exploring!</p>
            </main>
        </div>
    );
};

export default Dashboard;
